sys_variable_value.value:
(function execute(inputs, outputs){
 try {
         var load_status = true;
         var gl = new global.GSLog("sn_vul.usb.logging.verbosity", "DataTheorem_Load_" + inputs.DataSourceLoadType);

         XFC = new global.DataTheorem_ImportAttUtil();

	     XFC.importAtt(inputs.DataSource);

       } catch (ex) {
                gl.logError(gs.getMessage('sn_vul', ex));
                load_status = false;
       }
}
)(inputs, outputs);

